import React, { useState } from 'react';
import { ChevronDown, ChevronRight, CheckCircle, XCircle, Clock, Play, AlertCircle, Eye, Download, FileText } from 'lucide-react';

// 定义节点处理数据的类型
interface NodeProcessingData {
  status: string;
  startTime: string;
  endTime: string;
  duration: string;
  result: string;
  details: string;
  outputSize: string;
  // 添加处理结果相关字段
  hasOutput: boolean;
  outputPreview?: string;
  outputType: string;
  outputUrl?: string;
}

interface FileProcessingData {
  fileId: string;
  fileName: string;
  fileType: string;
  fileSize: string;
  overallStatus: string;
  currentNode: string;
  originalContent?: string; // 原始文件内容预览
  nodeProcessing: { [key: string]: NodeProcessingData };
}

const ExecutionDetails: React.FC = () => {
  const [expandedFiles, setExpandedFiles] = useState<string[]>([]);
  const [viewingResult, setViewingResult] = useState<{fileId: string, nodeName: string} | null>(null);

  // 根据文件类型获取对应的解析节点名称
  const getParseNodeName = (fileType: string): string => {
    switch (fileType.toLowerCase()) {
      case 'txt':
      case 'docx':
      case 'doc':
      case 'pdf':
        return '文本解析节点';
      case 'jpg':
      case 'png':
      case 'gif':
      case 'bmp':
      case 'svg':
        return '图片解析节点';
      case 'mp3':
      case 'wav':
      case 'flac':
      case 'aac':
        return '音频解析节点';
      case 'mp4':
      case 'avi':
      case 'mov':
      case 'wmv':
        return '视频解析节点';
      default:
        return '文本解析节点';
    }
  };

  // 文件处理数据 - 扩展原有表格数据，添加处理结果
  const tableData: FileProcessingData[] = [
    {
      fileId: 'file-1',
      fileName: '通过评分网-1.jpg',
      fileType: 'jpg',
      fileSize: '2.5MB',
      overallStatus: '处理完成',
      currentNode: '增强节点',
      originalContent: '原始图片: 1920x1080像素，包含评分网页面截图',
      nodeProcessing: {
        '图片解析节点': { 
          status: 'completed', 
          result: '解析成功，提取图片元数据', 
          duration: '14s',
          startTime: '2024-08-19 14:52:24',
          endTime: '2024-08-19 14:52:38',
          details: '解析完成',
          outputSize: '2KB',
          hasOutput: true,
          outputType: 'metadata',
          outputPreview: JSON.stringify({
            "width": 1920,
            "height": 1080,
            "format": "JPEG",
            "title": "通过评分网",
            "text_regions": ["评分", "通过", "4.5/5"],
            "objects": ["button", "text", "logo"],
            "colors": ["#4F46E5", "#10B981", "#F59E0B"],
            "text_confidence": 0.95
          }, null, 2)
        },
        '清洗节点': { 
          status: 'completed', 
          result: '数据清洗完成', 
          duration: '30s',
          startTime: '2024-08-19 14:52:38',
          endTime: '2024-08-19 14:53:08',
          details: '清洗完成',
          outputSize: '1.8KB',
          hasOutput: true,
          outputType: 'structured_data',
          outputPreview: JSON.stringify({
            "score": 4.5,
            "max_score": 5.0,
            "status": "通过",
            "category": "评分网站",
            "confidence": 0.95,
            "extracted_text": "评分通过4.5/5",
            "image_quality": "high",
            "clarity_score": 0.92
          }, null, 2)
        },
        '增强节点': { 
          status: 'completed', 
          result: '增强处理完成', 
          duration: '15s',
          startTime: '2024-08-19 14:53:08',
          endTime: '2024-08-19 14:53:23',
          details: '增强完成',
          outputSize: '3.2KB',
          hasOutput: true,
          outputType: 'enhanced_data',
          outputPreview: JSON.stringify({
            "score": 4.5,
            "max_score": 5.0,
            "status": "通过",
            "category": "评分网站",
            "confidence": 0.95,
            "sentiment": "positive",
            "keywords": ["评分", "通过", "优秀"],
            "recommendation": "高质量内容",
            "enhanced_metadata": {
              "quality_score": 0.9,
              "relevance": 0.85,
              "visual_appeal": 0.88
            },
            "ai_insights": "图片显示了一个成功的评分界面，用户体验良好"
          }, null, 2)
        }
      }
    },
    {
      fileId: 'file-2',
      fileName: '通过评分网-2.docx',
      fileType: 'docx',
      fileSize: '1.2MB',
      overallStatus: '处理中',
      currentNode: '清洗节点',
      originalContent: '原始文档内容: 包含评分网站分析报告，共5页内容',
      nodeProcessing: {
        '文本解析节点': { 
          status: 'completed', 
          result: '解析成功，提取文本内容', 
          duration: '29s',
          startTime: '2024-08-19 14:52:24',
          endTime: '2024-08-19 14:52:53',
          details: '解析完成',
          outputSize: '15KB',
          hasOutput: true,
          outputType: 'text',
          outputPreview: '评分网站分析报告\n\n一、概述\n本报告分析了当前评分网站的使用情况...\n\n二、数据统计\n- 总用户数: 15,432\n- 平均评分: 4.2/5.0\n- 活跃度: 78%\n- 页面浏览量: 234,567\n\n三、用户反馈\n大多数用户对评分系统表示满意...\n\n四、结论\n评分系统运行良好，用户满意度较高，建议进一步优化界面设计...'
        },
        '清洗节点': { 
          status: 'processing', 
          result: '正在进行数据清洗...', 
          duration: '进行中(2分30秒)',
          startTime: '2024-08-19 14:52:53',
          endTime: '',
          details: '处理中',
          outputSize: '',
          hasOutput: false,
          outputType: 'processing',
          outputPreview: '处理中...\n当前进度: 65%\n正在清洗文本格式和无效字符...\n已处理段落: 23/35\n正在提取关键信息...'
        },
        '增强节点': { 
          status: 'pending', 
          result: '等待清洗完成', 
          duration: '-',
          startTime: '',
          endTime: '',
          details: '等待中',
          outputSize: '',
          hasOutput: false,
          outputType: 'pending'
        }
      }
    },
    {
      fileId: 'file-3',
      fileName: '通过评分网-3.txt',
      fileType: 'txt',
      fileSize: '500KB',
      overallStatus: '处理失败',
      currentNode: '文本解析节点',
      originalContent: '原始文件: 编码格式错误，无法正常读取内容',
      nodeProcessing: {
        '文本解析节点': { 
          status: 'failed', 
          result: '解析失败', 
          duration: '4s',
          startTime: '2024-08-19 14:52:24',
          endTime: '2024-08-19 14:52:28',
          details: '解析失败',
          outputSize: '',
          hasOutput: true,
          outputType: 'error',
          outputPreview: 'Error: UnicodeDecodeError\n无法解码文件内容\n检测到的编码: unknown\n文件大小: 500KB\n错误位置: 第3行，第127个字符\n建议: 请检查文件编码格式或重新保存文件为UTF-8格式\n\n常见解决方案:\n1. 使用记事本打开文件，另存为UTF-8编码\n2. 检查文件是否包含特殊字符\n3. 联系管理员获取技术支持'
        },
        '清洗节点': { 
          status: 'skipped', 
          result: '跳过处理', 
          duration: '-',
          startTime: '',
          endTime: '',
          details: '已跳过',
          outputSize: '',
          hasOutput: false,
          outputType: 'skipped'
        },
        '增强节点': { 
          status: 'skipped', 
          result: '跳过处理', 
          duration: '-',
          startTime: '',
          endTime: '',
          details: '已跳过',
          outputSize: '',
          hasOutput: false,
          outputType: 'skipped'
        }
      }
    },
    {
      fileId: 'file-4',
      fileName: '通过评分网-4.mp3',
      fileType: 'mp3',
      fileSize: '2.5MB',
      overallStatus: '处理完成',
      currentNode: '音频解析节点',
      originalContent: '原始音频: 时长2分钟，包含评分网站背景音乐',
      nodeProcessing: {
        '音频解析节点': { 
          status: 'completed', 
          result: '解析成功，提取音频元数据', 
          duration: '14s',
          startTime: '2024-08-19 14:52:24',
          endTime: '2024-08-19 14:52:38',
          details: '解析完成',
          outputSize: '2KB',
          hasOutput: true,
          outputType: 'metadata',
          outputPreview: JSON.stringify({
            "duration": "2:00",
            "bitrate": "128kbps",
            "sample_rate": "44.1kHz",
            "channels": 2,
            "title": "通过评分网背景音乐",
            "artist": "未知",
            "album": "未知",
            "genre": "流行"
          }, null, 2)
        },
        '清洗节点': { 
          status: 'completed', 
          result: '数据清洗完成', 
          duration: '30s',
          startTime: '2024-08-19 14:52:38',
          endTime: '2024-08-19 14:53:08',
          details: '清洗完成',
          outputSize: '1.8KB',
          hasOutput: true,
          outputType: 'structured_data',
          outputPreview: JSON.stringify({
            "score": 4.5,
            "max_score": 5.0,
            "status": "通过",
            "category": "评分网站",
            "confidence": 0.95,
            "extracted_text": "通过评分网背景音乐",
            "audio_quality": "high",
            "clarity_score": 0.92
          }, null, 2)
        },
        '增强节点': { 
          status: 'completed', 
          result: '增强处理完成', 
          duration: '15s',
          startTime: '2024-08-19 14:53:08',
          endTime: '2024-08-19 14:53:23',
          details: '增强完成',
          outputSize: '3.2KB',
          hasOutput: true,
          outputType: 'enhanced_data',
          outputPreview: JSON.stringify({
            "score": 4.5,
            "max_score": 5.0,
            "status": "通过",
            "category": "评分网站",
            "confidence": 0.95,
            "sentiment": "positive",
            "keywords": ["通过", "评分网", "背景音乐"],
            "recommendation": "高质量音乐",
            "enhanced_metadata": {
              "quality_score": 0.9,
              "relevance": 0.85,
              "visual_appeal": 0.88
            },
            "ai_insights": "音频显示了一个成功的评分界面，用户体验良好"
          }, null, 2)
        }
      }
    },
    {
      fileId: 'file-5',
      fileName: '通过评分网-5.mp4',
      fileType: 'mp4',
      fileSize: '5.5MB',
      overallStatus: '处理完成',
      currentNode: '视频解析节点',
      originalContent: '原始视频: 时长3分钟，包含评分网站广告',
      nodeProcessing: {
        '视频解析节点': { 
          status: 'completed', 
          result: '解析成功，提取视频元数据', 
          duration: '14s',
          startTime: '2024-08-19 14:52:24',
          endTime: '2024-08-19 14:52:38',
          details: '解析完成',
          outputSize: '2KB',
          hasOutput: true,
          outputType: 'metadata',
          outputPreview: JSON.stringify({
            "duration": "3:00",
            "bitrate": "1000kbps",
            "resolution": "1920x1080",
            "title": "通过评分网广告",
            "text_regions": ["通过", "评分网", "广告"],
            "objects": ["button", "text", "logo"],
            "colors": ["#4F46E5", "#10B981", "#F59E0B"],
            "text_confidence": 0.95
          }, null, 2)
        },
        '清洗节点': { 
          status: 'completed', 
          result: '数据清洗完成', 
          duration: '30s',
          startTime: '2024-08-19 14:52:38',
          endTime: '2024-08-19 14:53:08',
          details: '清洗完成',
          outputSize: '1.8KB',
          hasOutput: true,
          outputType: 'structured_data',
          outputPreview: JSON.stringify({
            "score": 4.5,
            "max_score": 5.0,
            "status": "通过",
            "category": "评分网站",
            "confidence": 0.95,
            "extracted_text": "通过评分网广告",
            "video_quality": "high",
            "clarity_score": 0.92
          }, null, 2)
        },
        '增强节点': { 
          status: 'completed', 
          result: '增强处理完成', 
          duration: '15s',
          startTime: '2024-08-19 14:53:08',
          endTime: '2024-08-19 14:53:23',
          details: '增强完成',
          outputSize: '3.2KB',
          hasOutput: true,
          outputType: 'enhanced_data',
          outputPreview: JSON.stringify({
            "score": 4.5,
            "max_score": 5.0,
            "status": "通过",
            "category": "评分网站",
            "confidence": 0.95,
            "sentiment": "positive",
            "keywords": ["通过", "评分网", "广告"],
            "recommendation": "高质量广告",
            "enhanced_metadata": {
              "quality_score": 0.9,
              "relevance": 0.85,
              "visual_appeal": 0.88
            },
            "ai_insights": "视频显示了一个成功的评分界面，用户体验良好"
          }, null, 2)
        }
      }
    }
  ];

  // 为了兼容表格显示，添加辅助函数
  const getDisplayData = (file: FileProcessingData) => {
    const parseNodeName = getParseNodeName(file.fileType);
    return {
      ...file,
      status: file.overallStatus,
      createTime: file.nodeProcessing[parseNodeName]?.startTime || '2024-08-19 14:52:24',
      updateTime: Object.values(file.nodeProcessing).find(node => node.endTime)?.endTime || file.nodeProcessing[parseNodeName]?.startTime || '2024-08-19 14:52:24',
      note: file.overallStatus === '处理失败' ? '解析错误' : file.overallStatus === '处理中' ? `当前在${file.currentNode}` : '-',
      statusColor: file.overallStatus === '处理完成' ? 'text-green-600' : 
                   file.overallStatus === '处理中' ? 'text-blue-600' : 
                   file.overallStatus === '处理失败' ? 'text-red-600' : 'text-gray-600',
      statusIcon: file.overallStatus === '等待中' ? '○' : '●'
    };
  };

  const toggleFileExpansion = (fileId: string) => {
    setExpandedFiles(prev => 
      prev.includes(fileId) 
        ? prev.filter(id => id !== fileId)
        : [...prev, fileId]
    );
  };

  const openResultViewer = (fileId: string, nodeName: string) => {
    setViewingResult({ fileId, nodeName });
  };

  const closeResultViewer = () => {
    setViewingResult(null);
  };

  const getNodeStatusIcon = (status: string) => {
    switch (status) {
      case 'completed': return <CheckCircle className="w-3 h-3 text-green-600" />;
      case 'processing': return <Play className="w-3 h-3 text-blue-600" />;
      case 'failed': return <XCircle className="w-3 h-3 text-red-600" />;
      case 'pending': return <Clock className="w-3 h-3 text-gray-400" />;
      case 'skipped': return <AlertCircle className="w-3 h-3 text-orange-500" />;
      default: return <Clock className="w-3 h-3 text-gray-400" />;
    }
  };

  const getNodeStatusColor = (status: string) => {
    switch (status) {
      case 'completed': return 'text-green-600';
      case 'processing': return 'text-blue-600';
      case 'failed': return 'text-red-600';
      case 'pending': return 'text-gray-400';
      case 'skipped': return 'text-orange-500';
      default: return 'text-gray-400';
    }
  };

  const getCurrentFile = () => {
    if (!viewingResult) return null;
    return tableData.find(file => file.fileId === viewingResult.fileId);
  };

  const getCurrentNodeData = (): NodeProcessingData | null => {
    const file = getCurrentFile();
    if (!file || !viewingResult) return null;
    return file.nodeProcessing[viewingResult.nodeName] || null;
  };

  return (
    <div className="bg-white rounded-lg border border-gray-200 p-6">
      <h2 className="text-lg font-semibold text-gray-900 mb-4">执行详情</h2>

      <div className="mb-4 flex items-center justify-between">
        <div className="text-sm text-gray-600">
          文件处理进度量 
          <span className="ml-2">
            处理成功 <span className="text-blue-600 font-medium">48/100</span> 
            处理失败数 <span className="text-red-600 font-medium">5/100</span>
          </span>
        </div>
        <button className="text-sm text-blue-600 hover:text-blue-800">
          重试
        </button>
      </div>

      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                文件名
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                状态
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                节点处理状态
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                文件类型
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                开始时间
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                结束时间
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                详情
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                操作
              </th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {tableData.map((file, index) => {
              const row = getDisplayData(file);
              return (
              <React.Fragment key={file.fileId}>
                <tr className="hover:bg-gray-50">
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {file.fileName}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm">
                    <span className={`${row.statusColor} flex items-center`}>
                      <span className="mr-1">{row.statusIcon}</span>
                      {row.status}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm">
                    <div className="flex items-center space-x-2">
                      {Object.entries(file.nodeProcessing).map(([nodeName, nodeData]) => (
                        <div key={nodeName} className="flex items-center space-x-1">
                          {getNodeStatusIcon(nodeData.status)}
                          <span className={`text-xs ${getNodeStatusColor(nodeData.status)}`}>
                            {nodeName.replace('节点', '')}
                          </span>
                        </div>
                      ))}
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {file.fileType}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {row.createTime}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {row.updateTime}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {row.note}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm">
                    <button
                      onClick={() => toggleFileExpansion(file.fileId)}
                      className="text-blue-600 hover:text-blue-800 flex items-center"
                    >
                      {expandedFiles.includes(file.fileId) ? (
                        <>
                          <ChevronDown className="w-4 h-4 mr-1" />
                          收起
                        </>
                      ) : (
                        <>
                          <ChevronRight className="w-4 h-4 mr-1" />
                          详情
                        </>
                      )}
                    </button>
                  </td>
                </tr>

                {/* 展开的节点详情行 */}
                {expandedFiles.includes(file.fileId) && (
                  <tr>
                    <td colSpan={8} className="px-6 py-4 bg-gray-50">
                      <div className="space-y-4">
                        <h4 className="font-medium text-gray-900">节点处理详情</h4>

                        {/* 原始文件预览 */}
                        <div className="p-3 bg-white rounded border">
                          <div className="flex items-center justify-between mb-2">
                            <div className="flex items-center space-x-2">
                              <FileText className="w-4 h-4 text-gray-500" />
                              <span className="font-medium text-gray-900">原始文件</span>
                            </div>
                            <button 
                              onClick={() => openResultViewer(file.fileId, '原始文件')}
                              className="flex items-center space-x-1 text-blue-600 hover:text-blue-800 text-sm"
                            >
                              <Eye className="w-3 h-3" />
                              <span>查看内容</span>
                            </button>
                          </div>
                          <p className="text-sm text-gray-600">{file.originalContent}</p>
                        </div>

                        {/* 节点处理结果 */}
                        <div className="grid grid-cols-1 gap-3">
                          {Object.entries(file.nodeProcessing).map(([nodeName, nodeData]) => (
                            <div key={nodeName} className="p-3 bg-white rounded border">
                              <div className="flex items-center justify-between mb-2">
                                <div className="flex items-center space-x-3">
                                  {getNodeStatusIcon(nodeData.status)}
                                  <div>
                                    <span className="font-medium text-gray-900">{nodeName}</span>
                                    <p className="text-sm text-gray-600">{nodeData.result}</p>
                                  </div>
                                </div>
                                <div className="flex items-center space-x-2">
                                  {nodeData.hasOutput && (
                                    <button 
                                      onClick={() => openResultViewer(file.fileId, nodeName)}
                                      className="flex items-center space-x-1 text-blue-600 hover:text-blue-800 text-sm"
                                    >
                                      <Eye className="w-3 h-3" />
                                      <span>查看结果</span>
                                    </button>
                                  )}
                                  <div className="text-right">
                                    <div className={`text-sm font-medium ${getNodeStatusColor(nodeData.status)}`}>
                                      {nodeData.status === 'completed' ? '已完成' : 
                                       nodeData.status === 'processing' ? '处理中' :
                                       nodeData.status === 'failed' ? '失败' :
                                       nodeData.status === 'skipped' ? '已跳过' : '等待中'}
                                    </div>
                                    <div className="text-sm text-gray-500">
                                      耗时: {nodeData.duration}
                                    </div>
                                  </div>
                                </div>
                              </div>
                            </div>
                          ))}
                        </div>
                      </div>
                    </td>
                  </tr>
                )}
              </React.Fragment>
            )})}
          </tbody>
        </table>
      </div>

      {/* 处理结果查看器模态框 */}
      {viewingResult && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white rounded-lg max-w-4xl w-full mx-4 max-h-[80vh] overflow-hidden">
            <div className="flex items-center justify-between p-4 border-b border-gray-200">
              <h3 className="text-lg font-semibold text-gray-900">
                {getCurrentFile()?.fileName} - {viewingResult.nodeName}处理结果
              </h3>
              <div className="flex items-center space-x-2">
                <button className="flex items-center space-x-1 px-3 py-1 text-sm text-blue-600 hover:text-blue-800 border border-blue-200 rounded">
                  <Download className="w-3 h-3" />
                  <span>下载</span>
                </button>
                <button
                  onClick={closeResultViewer}
                  className="text-gray-400 hover:text-gray-600"
                >
                  <XCircle className="w-5 h-5" />
                </button>
              </div>
            </div>
            <div className="p-4 overflow-y-auto max-h-[60vh]">
              {viewingResult.nodeName === '原始文件' ? (
                <div className="space-y-3">
                  <div className="text-sm text-gray-600 mb-3">原始文件内容预览:</div>
                  <div className="bg-gray-50 p-4 rounded border font-mono text-sm">
                    {getCurrentFile()?.originalContent}
                  </div>
                </div>
              ) : (
                <div className="space-y-3">
                  <div className="text-sm text-gray-600 mb-3">
                    节点输出类型: {getCurrentNodeData()?.outputType}
                  </div>
                  <div className="bg-gray-50 p-4 rounded border">
                    <pre className="text-sm whitespace-pre-wrap">
                      {getCurrentNodeData()?.outputPreview || '暂无输出内容'}
                    </pre>
                  </div>
                  {getCurrentNodeData()?.outputType === 'error' && (
                    <div className="mt-3 p-3 bg-red-50 border border-red-200 rounded">
                      <div className="text-sm font-medium text-red-800 mb-1">错误信息</div>
                      <div className="text-sm text-red-600">
                        建议检查文件格式或联系管理员
                      </div>
                    </div>
                  )}
                </div>
              )}
            </div>
          </div>
        </div>
      )}

      {/* Pagination */}
      <div className="mt-4 flex items-center justify-center space-x-2">
        <span className="px-3 py-1 bg-blue-600 text-white text-sm rounded">1</span>
        <span className="px-3 py-1 text-gray-600 text-sm cursor-pointer hover:bg-gray-100 rounded">2</span>
        <span className="px-3 py-1 text-gray-600 text-sm cursor-pointer hover:bg-gray-100 rounded">3</span>
        <span className="px-3 py-1 text-gray-600 text-sm cursor-pointer hover:bg-gray-100 rounded">4</span>
        <span className="px-3 py-1 text-gray-600 text-sm cursor-pointer hover:bg-gray-100 rounded">5</span>
        <button className="px-3 py-1 text-gray-600 text-sm cursor-pointer hover:bg-gray-100 rounded">
          <ChevronRight className="w-4 h-4" />
        </button>
      </div>
    </div>
  );
};

export default ExecutionDetails;
